  false,\n\t\"url\": null,\n\t\"notes\": \"LIDAR data is remotely sensed high-resolution
  elevation data collected by an airborne collection platform. By positioning laser
  range finding with the use of 1 second GPS with 100hz inertial measurement unit
  corrections Terrapoint's LIDAR instruments are able to make highly detailed geospatial
  elevation products of the ground, man-made structures and vegetation. The LiDAR
  flightlines for this project were planned for a 50% acquisition overlap. The nominal
  resolution of this project without overlap is 1.37m spacing, but effectively is
  2.74m with overlap factored. Four returns were recorded for each pulse in addition
  to an intensity value. GPS Week Time, Flightline number and scan angle attributes
  were provided for each LiDAR point. Data is provided as random points, in LAS v1.0
  format, classified according to ASPRS Class Code 1= Undefined, 2=Ground.\",\n\t\"owner_org\":
